import React, { Fragment } from 'react';
import { View, Text, Image } from 'react-native';
import { colors } from '../styles';
import Button from './Button';
import { images } from '../images';

function Profile() {
	return (
		<Fragment>
			<View style={{ backgroundColor: colors.mainColor, paddingVertical: 100 }} />
			<View
				style={{
					borderTopRightRadius: 30,
					borderTopLeftRadius: 30,
					paddingVertical: 70,
					backgroundColor: 'white'
				}}
			>
				<Text style={{ marginRight: 'auto', marginLeft: 'auto', width: 220, textAlign: 'center' }}>
					هم اکنون به جمع بافردو بپیوندید و از تخفیف ها زودتر از بقیه مطلع شوید.
				</Text>
				<View style={{ justifyContent: 'center', alignItems: 'center', marginTop: 40 }}>
					<Button width={200} text="ورود / ثبت نام" />
				</View>
			</View>
			<View
				style={{
					backgroundColor: 'white',
					borderTopRightRadius: 30,
					borderTopLeftRadius: 30,
					marginTop: 20,
					flexDirection: 'row',
					justifyContent: 'space-between',
					paddingHorizontal: 100,
					paddingVertical: 10
				}}
			>
				{images.map((each, index) => {
					return <Image key={index} source={each.url} style={{ width: 20, height: 20 }} />;
				})}
			</View>
		</Fragment>
	);
}

export default Profile;
